import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Navigation from './';
import Login from './Login'; // Import your Login component
import Register from './Register'; // Import your Register component
import PatientDashboard from './PatientDashboard'; // Import your PatientDashboard component
import DoctorDashboard from './DoctorDashboard'; // Import your DoctorDashboard component

function App() {
  return (
    <Router>
      <div>
        <Navigation />
        <Route path="/login" component={Login} />
        <Route path="/register" component={Register} />
        <Route path="/patient" component={PatientDashboard} />
        <Route path="/doctor" component={DoctorDashboard} />
        {/* Add more routes for other user roles */}
      </div>
    </Router>
  );
}

export default App;
